in_code: |-
  S" Hello, what is your name?" VARIABLE what
  S" Hello, " VARIABLE hello_name
  0x0 VARIABLE index
  0x0 VARIABLE dup_ind
  0x0 VARIABLE len
  _start:
      in 0
      dup
      if name
      lit 48
      call rep
      !
      lit dup_ind
      lit index @
      !
      call hello
      lit index
      lit dup_ind @
      !
  while:
      in 0
      out 2
      lit index
      @
      lit 1
      call rep
      dup
      if end
      !
      jump while
  rep:
      swap
      -
      lit index
      swap
      ret
  hello:
      lit len
      lit hello_name @
      !
      lit index
      lit hello_name
      lit 4
      +
      !
  while_hello:
      lit index @ @
      out 2
      lit index
      dup
      @
      lit 4
      +
      !
      lit 1
      lit len @
      -
      dup
      if end_hello
      lit len
      swap
      !
      jump while_hello
  name:
      lit len
      lit what @
      !
      lit index
      lit what
      lit 4
      +
      !
  while_name:
      lit index @ @
      out 2
      lit index
      dup
      @
      lit 4
      +
      !
      lit 1
      lit len @
      -
      dup
      if end
      lit len
      swap
      !
      jump while_name
  end_hello:
      ret
  end:
      halt
